import './App.css';
import Navbar from './components/Navbar';
import Input from './components/Input';

function App() {
  return (
    <>
      <Navbar/>
      <div className="container">
        <Input/>
           <button type="button" class="btn btn-primary">Primary</button>
      </div>
    </>
  );
}

export default App;
